    const { auth, tour } = useAppSelector(tourData => tourData);
    const dispatch = useAppDispatch();

    useEffect(() => {
        if(!auth.user?.id){
            return;
        }
        dispatch(getToursById(auth.user.id || ""));
    }, []);
  return (
    <div>Dashboard</div>
